                <img src={coin} alt="Coin"/>
                <p>1231</p>
              </div>
            </div>
          </nav>  
        </div>
      </header>
        <Route exact path="/">
          <Productos/>
        </Route>
        <Route exact path="/mas-creditos">
          <Creditos />
        </Route>
        <Route exact path="/historial">
          <Historial />
        </Route>
        <Route exact path="/producto">
          <Item />
        </Route>
      <Footer />
    </div>
  );
}

export default App;
